    "url": "https://tly.wikipedia.org/wiki/S%C9%99rlovh%C9%99",
    "title": "Vikipedija",
    "content": "Bə mətni dəvarde Сy Vikipedija Xəš oməjon bə Vikipedija, sərbəstə ensiklopedijə kom harki bəzyne sərost kardej. Ysət Tolyšə zyvonədə 10,050 məǧolə heste. 9 Dekabr 2025, Sešambə Haftə vyžnijə nyvyštəj Bekəǧə Mirsalajev Mirsalajev Bekəǧə Əbulfəti zoə (22 janvar 1893 sor, Rəzgov di, Zuvandi rəjon, Lankoni ǧəzo, Urusijəti imperijə — 8 janvar 1938 sor, Azərbojčoni SSR) — tolyšə ičtimoi-sijosijə xodim, Kommunistə partijə (bolševikon) Zakavkazə Kraj komitə dyminə kotib. 1906 sorədə əcəj 13 sinənədə əcəj xyjzon bə Boku ovašte. Əǧylətijədə nati gyrdə kardə vyronədə yštə ko bino kardyše. Ko karde vaxtonədə əv yštə zynəjonən, yštə təhsiliən səjdəbe. Sabuncijədə 3-sinifə məktəbi oryxniše. 1918 sorədə bə yštə di Rəzgov ogarde u əjo Mistani dij čəmjəti šurədə kotib ko kardyše. Pešo əcəj xyjzon bə Lankon ovašte. Myǧon-Šurə Respublikə Myǧon-Šurə Respublikə elon kardejədə əv aktiv rolyš byə. Cy Respublikə Məholi Šurə Jol gyləj partizanə ǧysmi jol - Lankonədə inǧylobə usjonədə ištirokəkə David Cirkin vyžnijə byəbe, u əcəj myovini vyrədə Širəli Axundov be. Bolševikon dylədə be-be Bekəǧə bə yštə divoži abrek Junus Abbasovi dastə nydəše, əmma cy tolyšə syə partizani Bala Məmmədi dastədə be u pešo kejnə Junus bə šurə tərəf ovašte, Bekəǧə bə əcəj dastə umžən be. Myǧon-Šurə Respublikə soxte bəpeštə, Širəli Axundov xəjli gəp žəjdə de tolyšə abreki Junus Abbasovi (Junus Rəzgovyži) u əv de Bekəǧə Mirsalajevi dastəki zynejdə əj bə šurə tərəfi okyrnije. Junusi cy \"Zyvandi ucastok\" komissar təjin kardejdən. Ofəjevonəti Bekəǧə bo məktobon dutejro, təhsili səvijə rost kardejro, čyvonon bə ədəbijoti u nəčiməsənəti sahə sədo kardejro, tolyšə zyvoni ozavaijero xəjli dast-pocə kardejdəbe Lankoni rəjonədə. 21 janvar 1931 soriku de Bekəǧə Mirasalajevi redaktorəti u Muzəffər Nəsirlo kotibəti tolyšə ružnomə \"Sıə Tolış\" bino kardyše cap be. Həbs be u kyšte 15 nojabr 1936 sorədə Bekəǧəšon həbs karde, gynošon nyvyšte ki, 1934 soriku əv ištirokəkə u cy Azərbojčoni millətpərəstə buržuazon «Lankoni filiali millijətpərəstə əlejh u usjonəkə-terroristə təškiloti» soxtəkəs, kom məǧsədyš hest be «Lankoni cy Azərbojčoniku čo karde» u «Tolyšə muxtarijət» soxte, «Lankoni rəjonədə bo usjonəkə daston odəmon hozy kardejdəbe u bo Azərbojčoni Kompartijə rəhbəron əlejh terroristə akton hozy kardejdəbe». 7 janvar 1938 sorədə de SSRI Ali Məhkəmə Hərbijə kollegijə ǧərori Mirsalajev taxsyrin hisob be de Azərbojčon SSR Činojətə Məčəllə 64, 70 u 73 maddon u bə gullə žəj de əmloki mysodirə karde məhkum kardə be. 1938 sori šəvədə janvari 7 bə 8 ǧəror bə vyrə rosnijə be. (bə məǧolə dəvarde...) Vyžnijə nyvyštəj Kuəzingi nəǧyl kəšə rəsm Tolyšə xəlǧi nəǧylon — tolyšə xəlǧi šifohi ofəjevonəti əsəron. Har xəlǧi nəǧylon ijən əfsonon — rufi mədənijəti gyləj əhmijətinə poən, kom bənə xəlǧi šifohi ofəjevonəti čo nymunon cy etnosi šuuri təmsil kardejdən. Bə əmə rəsə tolyšə nəǧylon ijən əfsonon Avestəku rišə pegətəšone, taryxi vərəǧonku dəvardən ijən tolyšə mədənijətədə ve barzə vyrə gətejdə. Əvon handəkəson hele kardejdən odəmə səbarzi, rufi sərvəton ijən pokə ešǧi hisson ogəte, kom lap aktuale cəmə vaxtədə, əvon tovsijə kardejdən xošxosjətəti ijən humanizmi barz kardejdən. Tədǧyǧotəvonon de tolyšə folklori hələ XIX əsrədə həmrəǧ bejdəbin. Iminə tolyšə folklori nymunon dijə karde bəbe cy miəllimi Tejmurbek Bajraməlibekovi əsəronədə, məsələm 1894—1899 soronədə «Ǧafǧazi tojfon ijən vyron təsvir kardə məčmuə». Bajraməlibekovi se gylə məǧolonədə tolyšə nəǧylon, əfsonon ijən bovon barədə nyvyštyše. Tolyšə nəǧylonədə čurbəčurə personažon hestin: Div, Alažen, Alamerd, Ivyžəli, Əždəho, aǧylmandə həjvonon, igidə zoon komon yštəni divon dastonku peroxnijedən, zyrəkə vəju ki de yštə aǧyli iškilon həl kardejdə. Žygo həmmə tolyšə nəǧylon ǧədimiku bə ysət cəmə əčdodon mydrikəti nišon dojdə. (bə dumo dəvarde...) Vikipedija cice? Vikipedija (ing. Wikipedia) — internetədə ozodə, ce dynjo cand gylə xəlǧi zyvonədə de viki texnoloži cəmi bəštəxoši pesoxtə byə, əcəj pesoxtə odəmon pevylo kardə ensiklopedijəj. Cəj pesoxtomoniku žygošəj, mylxəs 2001-nə sori navonəni mangonku okoədəjonyš ružbəruž hejve bedə. Ym ensklopedijə ružbəruž tikəjən ve čər bedə. İnternetədə (Vikipedija) de texnloži cəmi koəkə ənhorə ozodə onlajn ensklopedijəj. Cəj bino 1999-nə soriku pegətə bedə. Ce lo sərredaktor ijən onəkəs Larri Senger ijən Bomis nomədə kompanijədə koəkə sərdor by lojro pulədə Čimmi Uels Viki texnoloži binoədə onlajn ensklopedijə tumo kardejro bə i čo rajsə oməjn. Cəj nomyšon Nupedija (Nu Pedija.čom)-šon nošone. Nupedija virtualə ensiklopedija 2000-nə soriku bə ko dəšej. Ingilisi zyvonədə pesoxtə bə ym ensklopedija bənəj viki sajti zyne nəbi. Əcəj bino alimon ijən sənətkon əjo noə bə nyvyštəjon sərisof kardə be. Nupedijadaə nyvyštəjon noj ko elangero 2003-nə sori əcəj bastej roədə bə raj oməjn. Nupedija baste ləzədə əjo 24 təmom bə 74 osəǧandə nyvyštəjon hestbin. Binoš ce Nupedijaku pegətə bə Vikipedija ožə ensklopedija 2001-nə soriku internetədə bə ko dəše. Ce Vikipedija Nuperijaku fərǧyš əve ki,əjo har xonəxo də",
