    "title": "Wikipedia",
    "content": "Jump to content From Simple English Wikipedia, the free encyclopedia Welcome to Wikipedia, the free encyclopedia that anyone can change. Search the 277,474 articles in the Simple English Wikipedia How to write Simple English pages · Useful pages · Simple talk · Categories · Help Schools Gateway (for users who want to make changes from a school) About Wikipedia This is the front page of the Simple English Wikipedia. Wikipedias are places where people work together to write encyclopedias in different languages. We use Simple English words and grammar here. The Simple English Wikipedia is for everyone, such as children and adults who are learning English. There are 277,474 articles on the Simple English Wikipedia. All of the pages are free to use. They have all been published under both the Creative Commons Attribution/Share-Alike License 4.0 International License and the GNU Free Documentation License. You can help here! You may change these pages and make new pages. Read the help pages and other good pages to learn how to write pages here. If you need help, you may ask questions at Simple talk. When writing articles here: Use Basic English words and shorter sentences. This allows people to understand complex terms or phrases. Write good pages. The best encyclopedia pages have useful, well-written information. Use the pages to learn and teach. These pages can help people learn English. You can also use them to make a new Wikipedia to help other people. Simple does not mean short. Writing in Simple English means that simple words are used. It does not mean readers want basic information. Articles do not have to be short to be simple; expand articles, add details, but use basic vocabulary. Be bold! Your article does not have to be perfect, because other editors will fix it and make it better. And most importantly, do not be afraid to start and make articles better yourself. Selected Very Good Article Fred McFeely Rogers (March 20, 1928 – February 27, 2003) was an American television personality, musician, puppeteer, writer, producer, and Presbyterian minister. He was the creator, producer, head writer, and host of the children\u0027s television series Mister Rogers\u0027 Neighborhood from 1968 until he retired in 2001. He was also the music composer for the program. Rogers was not happy with the television shows that children were seeing. He began to write and perform local Pittsburgh-area shows for children. In 1968, Eastern Educational Television Network began distributing Rogers\u0027s new show across the United States on WQED. For thirty years, Rogers became a television icon of children\u0027s entertainment and education. Rogers supported many public causes. In the Betamax case, the U.S. Supreme Court used what Rogers said before a lower court to support fair use television recording. Rogers also spoke before a U.S. Senate committee to support government money for children\u0027s television. In August 2001, Rogers retired from recording Mister Rogers\u0027 Neighborhood. In October 2002, doctors told him he had stomach cancer. He died from the disease a few months later on February 27, 2003. He was 74 years old. more... Other very good articles – Proposals – Requirements Selected Good Article A sentō at the Tokyo Open Air Architectural Museum Sentō are Japanese public bathhouses. People take baths together there. Many Japanese people think of sentō as an important part of Japanese culture, with its manners and ideas about communities. Sentō are not the same as onsen. Onsen are baths built on natural hot springs. Onsen water has dissolved rock in it. Sentō water is either tap water or well water. more... Other good articles – Proposals – Requirements Did you know... From a collection of Wikipedia\u0027s articles: ... that when Kristi Noem (pictured) was a U.S. Representative, she took online college classes and received intern credits because she was a congresswoman? ... that in In Guezzam less than four out of ten people can read or write? ... that Nobel laureate Geoffrey Hinton, who has been called the \"godfather of AI\", stopped working for Google in 2023 to \u0027freely\u0027 talk about the risks of AI? ... that poultry is the second most eaten type of meat after pork? ... that Olivia Rodrigo is the first artist to have their first two releases in the top 10 on Billboard Hot 100? ... that Medieval philosophy began in the historic city of Baghdad, now the capital of Iraq, in the 8th century? Archives – Start a new article – Nominate an article Knowledge groups Applied sciences Architecture (building) • Communication • Electronics • Engineering • Farming • Health • Industry • Medicine • Transport • Weather People and social studies Anthropology (study of people) • Archaeology (history of civilization) • Geography • Education • History • Language • Philosophy (abstract ideas) • Psychology • Sociology • Teaching Daily life, art and culture Animation • Art • Book • Cooking • Custom • Culture • Dance • Family • Games • Gardening • Leisure (free time) • Mo",
