    "content": "Jump to content From Wikipedia, the free encyclopedia \u003c Template:POTD Picture of the day archives: 2025 December \u003c 2025 December 12 2025 December 14 \u003e Picture of the day Glassblowing is a technique which inflates molten glass into a bubble (or parison), with the aid of a blowpipe. A person who blows glass is called a glassblower, while the head of a glassblowing workshop is known as a gaffer. The process was invented by Syrian craftsmen from Hama and Aleppo between 27 BC and 14 AD, who discovered the previously unknown property of glass that a molten blob can be inflated by introducing a small amount of air into it. It was then adopted across the Roman Empire and has been in use since then. Glassblowing utilises the liquid structure of glass, the atoms being held together by strong chemical bonds in a disordered and random network, which means that molten glass is viscous enough to be blown and gradually harden as it loses heat. This photograph shows a man working on a glass project after removing it from a kiln at Brooklyn Glass in New York City, United States.Photograph credit: Rhododendrites Archive – More featured pictures... See also [edit] Template:POTD protected/2025-12-13 Retrieved from \"https://en.wikipedia.org/w/index.php?title\u003dTemplate:POTD/2025-12-13\u0026oldid\u003d1325342701\" Category: Wikipedia Picture of the day December 2025 Search Search Template:POTD/2025-12-13 Add languages Add topic",
