    "title": "Template:POTD/2025-12-14 - Wikipedia",
    "content": "Jump to content From Wikipedia, the free encyclopedia \u003c Template:POTD Picture of the day archives: 2025 December \u003c 2025 December 13 2025 December 15 \u003e Picture of the day The leopard seal (Hydrurga leptonyx), also known as the sea leopard, is the second largest species of seal in the Antarctic, after the southern elephant seal. Its only natural predators are the killer whale and possibly the elephant seal. It feeds on a wide range of prey including cephalopods, other pinnipeds, krill, birds and fish. Together with the Ross seal, the crabeater seal and the Weddell seal, it is part of the tribe of Lobodontini seals. This photograph shows a leopard seal in the Antarctic Sound.Photograph: Godot13 Archive – More featured pictures... See also [edit] Template:POTD protected/2025-12-14 Retrieved from \"https://en.wikipedia.org/w/index.php?title\u003dTemplate:POTD/2025-12-14\u0026oldid\u003d1327279768\" Category: Wikipedia Picture of the day December 2025 Search Search Template:POTD/2025-12-14 Add languages Add topic",
