    "content": "Naar inhoud springen Uit Wikipedia, de vrije encyclopedie Welkom op Wikipedia De vrije encyclopedie Aantal artikelen: 2.205.508 Aantal actieve gebruikers: 9.291 Portaal van de week: Vlaggen en wapens Biologie Geschiedenis Kunst \u0026 Cultuur Landen \u0026 Volken Mens \u0026 Maatschappij Politiek Religie Sport Taal Wetenschap \u0026 Technologie Uitgelicht Statuut voor het Koninkrijk der Nederlanden Op 15 december 1954 ondertekende koningin Juliana het Statuut voor het Koninkrijk der Nederlanden in de Ridderzaal in Den Haag. Met de inwerkingtreding van het Statuut werden Nederland, Suriname en de Nederlandse Antillen gelijkwaardige landen binnen het Koninkrijk der Nederlanden. Het Statuut is sinds 1954 een aantal keer gewijzigd, bijvoorbeeld door de onafhankelijkheid van Suriname (1975), de status aparte van Aruba (1984) en Staatkundige hervormingen (2010). (Lees verder) Etalage Johan Helmich Roman Georgius Macropedius Beurtvaart Zeekoeien Geschiedenis van Gouda Westerse astrologie Neutral Milk Hotel Robert Oppenheimer Over Wikipedia Wikipedia is een online encyclopedie die ernaar streeft om in alle erkende talen informatie te bieden die objectief, verifieerbaar en vrij herbruikbaar is. Het project is gebaseerd op vijf basisprincipes. De Nederlandstalige versie startte op 19 juni 2001 en is met meer dan 2,2 miljoen artikelen de op vijf na grootste van circa 345 taalversies. De encyclopedie is vrij bewerkbaar. Dat houdt in dat iedereen tekst en afbeeldingen kan toevoegen of aanpassen, met inachtneming van de basisregels. Voor de bewerkers zijn er diverse hulppagina\u0027s beschikbaar. Er is ook een snelcursus voor nieuwelingen. Zaken uitproberen kan in de zandbak en vragen kunnen gesteld worden bij de helpdesk. Voor privacyvragen kunt u hier terecht. Wist je dat ... ... de Ethiopische atleet Abebe Bikila bij de Olympische Zomerspelen van 1964 op de marathon zijn legendarische Olympische titel van 1960 prolongeerde, ondanks een recente blindedarmoperatie? ... de Britse voormalig premier David Cameron via een buitenechtelijk kind afstamt van Willem IV, die ook een voorvader is van koning Charles? ... de Russische kosmonauten Joeri Gagarin en Valentina Teresjkova in respectievelijk 1961 en 1963 de eerste man en vrouw in de ruimte waren? ... het Latijn vernoemd is naar de streek Latium, het huidige Lazio, waar deze taal werd gesproken voordat ze zich over een groot deel van Europa verspreidde? ... het nummer Every Breath You Take van The Police geen zoet liefdesliedje is, maar gaat over stalking? Afbeelding Een twee weken oude goudhamster (Mesocricetus auratus) met rode ogen. Goudhamsters komen oorspronkelijk voor in Noord-Syrië en Zuid-Turkije. Actueel Oorlog in Gaza vanaf 2023 De oorlog Hamas-Israël is een escalatie van het Israëlisch-Palestijns conflict die begon op 7 oktober 2023 en zich ontwikkelde tot een Israëlische militaire invasie in de Gazastrook. De aanleiding van de bombardementen en het gestarte grondoffensief door Israël in de Gazastrook was een gecoördineerde verrassingsaanval door de militante beweging Hamas vanuit de Gazastrook op Israël, onder de naam Operatie Al-Aksa-storm (Lees verder) Recent overleden 14 dec Rob Reiner (78), Amerikaans acteur, regisseur en producent 12 dec Peter Greene (60), Amerikaans acteur 12 dec Paul de Nooijer (82), Nederlands fotograaf en filmmaker 11 dec John Fentener van Vlissingen (86), Nederlands zakenman 10 dec Sophie Kinsella (55), Brits auteur In het nieuws 14 dec Aanslag Bondi Beach Twee mannen, vader en zoon, plegen een terreuraanslag op joodse feestvierders op Bondi Beach, een populair strand in Sydney, Australië. Bij de schietpartij vallen minstens 16 doden. 26 nov Brand in het Wang Fuk Court In Tai Po, een woonwijk van Hongkong, verwoest een grote brand zeven wolkenkrabbers. Er komen zeker 160 mensen om het leven, ook zijn er nog tientallen vermisten. 12 nov Einde government shutdown in de Verenigde Staten De Amerikaanse president Donald Trump ondertekent een wet waarmee na 43 dagen een einde komt aan de government shutdown, de stillegging van de federale overheid in de Verenigde Staten. 15 december in de geschiedenis 1325 Enschede Enschede krijgt stadsrechten van bisschop Jan van Diest. 1944 Glenn Miller Een vliegtuig met aan boord de Amerikaanse bandleider Glenn Miller verdwijnt spoorloos boven Het Kanaal. 2000 Kerncentrale Tsjernobyl De kerncentrale in Tsjernobyl, vooral bekend van een kernramp ruim 14 jaar eerder, wordt definitief buiten gebruik gesteld. Zusterprojecten Wikipedia is onderdeel van de Wikimedia Foundation, een non-profitorganisatie, en heeft diverse zusterprojecten die ook van de wikisoftware gebruikmaken: Wikinieuws Vrije nieuwsbron WikiWoordenboek Vrij woordenboek Wikibooks Handleidingen \u0026 vrije boeken Wikisource Vrije bibliotheek Wikiquote Citaten \u0026 spreekwoorden Wikispecies Catalogus van levende wezens Wikiversity Vrije onderwijsprojecten Wikivoyage Vrije, wereldwijde reisgids Commons Vrije media Wikidata Vrije database Wikifuncties Bibliotheek met codefuncti",
