    "content": "Zum Inhalt springen Vun Wikipedia Wikipedia iss en Uffguckbichli mit iwwer zwee hunnert fuffzich Schprooche. Des deitsch Wikipedeli hot sei Schterdt in 2005 grickt unn sidder 2006 sinn mir an pdc.wikipedia.org. Alleweil henn mir 2.044 Ardickele in die Schprooch. Alli-ebber kann schreiwe unn helfe. Naduur | Glaawe | Blatznaame | Amische Voreldere | Leit | Bletz Wilkum zu der Wikipedia in Deitsch! Mer schwetze noch die Mudderschprooch Des Wikipedelche do iss en Project fer en Uffguckbichli uffbaue in Pennsilfaanisch Deitsch. Du bischt eiglaade fer mithelfe. Sidder em Tschulei 2005 sinn mir do, unn nau henn mir 2.044 Ardickele in dem do deitsche Uffguckbichli. Alliebber – even yeder Leser – kann ennich Ardickele verbessere, Mischteeks tscheensche, Ardickele vergreesere, odder Ardickele schenner mache. Kannscht yuscht rum gucke aa. Du kannscht even Ardickele nooch Category uffgucke. Awwer wann du witt, kannscht schreiwe en bissel, odder schreiwe viel. Yeder Ardickel hot en \"Gschwetz\" wo du some Comments gewwe kannscht. Hauptblaett : Es Nei Teschtament Schpelling Community Portal / FAQ in English Schwetzerei-Druppe / Learn spoken Pennsylvania Deitsch Was wittscht uffgucke? Kultscher, Gewohnheide unn Gsellschaft / Fleiss, Handlung unn Bisness Penna-deitsche Folk Culture · Grundsau Lodsch · Penna-deitsche Geschicht – Zeittafel · Schwetzerei-Druppe · Deutsch-Pennsylvanischer Arbeitskreis Gediere / Gscharr Bauerei · Schneegans · Hinkel · Guckbax · Welschhinkel · Waddefresser · Fleggel · New Holland Machine Company · Maschien · Conestoga Industrial Park Relitschion / Glaawe Brodeschdant · Gedollisch · Mennischt · Amisch · Grischt · Biwwel · Benschwewerleit · Weiss-Weggli Amisch · Falkner Swamp Church · Missionary Institute of the Evangelical Lutheran Church · Urglaawe Bletz Lengeschder · Kutzeschteddel · Berlin · Allenschteddel · Pennsilfaani · Harrisbarrig · Yaakobschteddel · Shenandoah Waelli · Susquehanna Rewwer · Palz · Schlegelschteddel Leit John A. Hostetler · Michael Sattler · Edward Hermany · Henry Harbaugh · Henry Funck Ardickele uff Pälzisch Pälzisch · 1. FC Kaiserslautern · Bezirksverband Palz · Haardtgebirge · Bockrem Ardickel fer de Munet Der Ewich Yeeger iss en geischtiches Wese, wu uff em Blobarrickgrat im Pennsilfaani wuhnt. Es gebt zwee deitliche Iwwerlieferinge um Ewicher Yeeger. Die aerscht, wu weitverbreit iss, haldet, as er en lufdicher Geischt iss. Zwetti haldet, as er en Verschpreche erfille muss. Im Urglaawe watt er sich wie en Zieb bsunne. weiderlese... Was fer Ardickel tschuuse fer de neegscht Munet? Was denkscht? Wadde-Scheier Do in die Wadde-Scheier finnt mer all die Wadde versammelt, ass mer vielleicht schunt kennt. Mer kann awwer aa deel annre Wadde finne, ass mer vielleicht schunt vergesse hatt, odder wu net glei eifalle welle, odder aa neie un nitzliche Wadde, ass mer vielleicht nie net gheert hat. Zum Beischpiel, kammer\u0027s Watt \"Amschel\" net unnich \"A\" finne, sunner unnich der Rubrick \"Veggle\" - un die Rubrick \"Veggle\" in der Rubrick \"Diere\" - un die Diere, die finnt mer nadierlich in die \"Naduur\". Die do Waddescheier is in alphabetischer (alphabetical) Ardning: English/Pennsylvania German/High German dictionary edit Vedderbortsch Neiichkeede Dinschdaag, de 9. Disember 2025 Sitter 2010 gebt\u0027s die Pälzisch Wikipedia (heit Rheifränggischi Wikipedia) Nuus aus Pennsylvania Deitschland Pfälzer Sprache baut Brücken (Mannheimer Morgen 06.03.2020) ‘Dunk,’ ‘sexist’ and other words that originated in Pennsylvania (PennLife 17.10.2019) Dr. Michael Werner erhält die Hermann Sinsheimer-Plakette in Freinsheim (Wochenblatt-Reporter 08.10.2019) German film exploring roots of Pennsylvania Dutch culture shown at Kutztown Folk Festival (mit Video) (Reading Eagle 10.07.2019) Where German is still spoken in the US (Deutsche Welle 10.07.2019) Wo in Amerika noch deutsch gesprochen wird (Deutsche Welle 08.07.2019) Test Wikipedli Sitter 2007 gebt\u0027s en Mennonite Blattdeitsch Test Wikipedli Sitter 2008 gebt’s en Schlesisches Test Wikipedli Neiichkeede Archiv edit Cause mir sinn all deitsche Bledder, es pennsilfaanisch-deitsch Uffguckbichli \"pdc.wikipedia.org\" watt unnerschtitzt bei \u0027m Deutsch-Pennsylvanischer Arbeitskreis e.V.; die pennsylvaanisch-deitsch Zeiding Hiwwe wie Driwwe; es Blatt P.A. Dutch Family History; der deitsch Wandel deitscherei.org; PA Dutch Dialect Project un endlich das Pennsylvaniadeitsch Board. Hoff du bsuchscht. Pennsilfaanisch Deitsch Pennsilfaanisch Deitsch, ass aa Pennsylvania German, Pennsylvania Dutch odder Pennsilfaanisch genennt watt, iss en Schprooch, wu g\u0027schwetzt watt bei verleicht 300,000 Leit in meh wie 20 Schteets in die USA un in Ontario (Kanadaa). Die meenschte Schwetzer sinn heit Amische un Fuhremennischte, wu deitsch aa heit noch schwetze zu ihre Kinner, awwer\u0027s gebt aa en latt Luthrische un Reformierte, wu die Mudderschprooch noch g\u0027schwetzt henn, wie sie en Kind waare. Weider lese: Pennsylvaanisch-Deitsch Schweschder Projects META-WIKI (en)/(de) Commons (en)/(de) Wiktio",
