    "title": "Queensland borders - Wikipedia",
    "content": "Jump to content From Wikipedia, the free encyclopedia Borders of the state of Queensland, Australia Queensland, the north-east state of Australia Queensland is the north-eastern state of Australia and has land borders with three other Australian states and territories: New South Wales (to the south), South Australia (to the south-west) and Northern Territory (to the west). To the north of Queensland is the Torres Strait separating the Australian mainland from Papua New Guinea. To the east of Queensland is the Coral Sea, part of the Pacific Ocean. There are many islands off the Queensland coast which form part of the state of Queensland. The far western boundary with the Northern Territory is aligned along the 138th meridian east until Poeppel Corner at the intersection of this meridian and the 26th parallel south. It is here that Queensland borders South Australia. The boundary follows this latitude until it reaches the 141st meridian east at Haddon Corner where the border turns south reaching Cameron Corner on the 29th parallel south, the most western part of the border with New South Wales. The border follows this latitude towards the coast at about the 154th meridian east before following the courses of a number of rivers, then across a number of mountain ranges until it reaches Point Danger. From west to east, these rivers are the Barwon River, Macintyre River and Dumaresq River. Southern border towns include Mungindi, Goondiwindi and Texas. 1838 Royal Geographical Society proposal [edit] James Vetch proposal, 1838 By 1838 the coastline of the Australian continent had been well defined by mariners such as James Cook, Matthew Flinders and Phillip Parker King. As for the interior of Australia, little was known by the European settlers except for the area south of a line from Moreton Bay to Victoria as it is now (the south-east of the continent). This knowledge had been obtained from the journeys of explorers such as John Oxley, Charles Sturt, Thomas Mitchell, Allan Cunningham and George Evans.[1] There were many proposals for the subdivision of the Australian continent dating back to the 1830s. This proposal by Captain James Vetch[2] was published by the Royal Geographical Society in their journal of 1838. Vetch tried to give each colony equal areas, possess a tract of sea coast with possible harbour sites and be as compact as possible.[1] The boundaries of his proposed colonies were defined using lines of latitude and longitude. This was generally used by colonial administrators when there was either no natural features such as rivers and ranges or due to exploration of the country not being well enough advanced to know if there were any natural features.[1] 1846 colony of North Australia [edit] The southern boundary of the short-lived Colony of North Australia, 1846–1847, was further north than the later boundary of Queensland. The loss of the American Colonies due to the American War of Independence (1775–1783) forced the British Government to find another place to send its convicted felons. Its most recent acquisition (1770) New Holland (now Australia) was chosen and the first penal settlement established at Port Jackson in 1788 by Captain Arthur Phillip. Other settlements soon followed, Norfolk Island, Van Diemen\u0027s Land (now Tasmania), Port Macquarie and in 1824 Moreton Bay.[1] In 1840 the transportation of convicts to New South Wales ceased although Van Diemen\u0027s Land continued to receive large numbers of convicts. When William Ewart Gladstone became Secretary of State for the Colonies in 1845, he was confronted with the problem of the large numbers of pardoned convicts roaming around Van Diemen\u0027s Land unable to find work. Rather than revive transportation to New South Wales, which he knew would be very unpopular, he decided to create a new colony in the northern part of New South Wales. To this new colony he proposed to send the pardoned convicts of Van Diemen\u0027s Land, and he hoped that in time they could form the backbone of a new vibrant free colony.[1] In May 1846, Lieutenant Colonel George Barney of the Royal Engineers was chosen as the new colony administrative head. He was soon despatched to Sydney and instructed to find a suitable site to the north of Moreton Bay, but not that far north that the tropical climate would have an adverse effect on the health of the settlers, preventing them from hard work and industry. Port Curtis (now Gladstone in Queensland) was chosen. Also in the same month, the official Letters Patent were issued by Queen Victoria forming a new colony to be called North Australia. The southern boundary of this new colony was to be 26 degrees of south latitude (just south of present day Maryborough, Queensland).[1] On 8 January 1847, the Lord Auckland sailed from Sydney with the new colonial officials and their families arriving at Port Curtis on 25 January 1847. On entering the port the Lord Auckland grounded on a shoal. The officials quickly headed for shore and a few days l",
