    "url": "https://gd.wikipedia.org/wiki/Pr%C3%AComh-Dhuilleag",
    "title": "Uicipeid",
    "content": "Jump to content O Uicipeid Fàilte gu Uicipeid na Gàidhlig – an leabhar-eòlais a tha fosgailte do dhuine sam bith! Thòisich sinn anns an t-Sultain, 2003, agus tha sinn a-nis ag obair air 16,019 aistidhean anns a’ Ghàidhlig. Aistidhean Matha agus na Naidheachdan · Roinnean-seòrsa · Na h-Aistidhean Gu Lèir Mu Uicipeid Seo Uicipeid na Gàidhlig. Ann an uicipeidean bidh iomadh neach ag obair ri chèile airson leabhar mòr-eòlais a sgrìobhadh ann an iomadh cànan. Tha 16,019 duilleagan san Uicipeid seo. Tha a h-uile tè dhiubh saor ri cleachdadh. Dè th\u0027 ann an Uicipeid?: Faic an ro-ràdh airson barrachd fios mu bhun-stèidh Uicipeid. Poileasaidhean na h-Uicipeid Stadastaireachd Taic is Cobhair Toiseach-tòiseachaidh: duilleagan fiosrachaidh gus sgrìobhadh ann an Uicipeid ionnsachadh Doras na Coimhearsnachd: làrach airson ceistean fhaighneachd Briathrachas: na faclan a chleachdas air Uicipeid Oisean an Luchd-tòiseachaidh (Learners\u0027 Corner) Artagail taghta Tutanmhamun: aghaidh òir Bha Tutankhamun \u0027na phàraoh ann an 18mh rìoghrachas na h-Èipheit. Bha e a’ riaghladh mu thuaiream eadar 1332 agus 1323 RC rè linn ann an eachdraidh na h-Èipheit air a bheil an Rìoghachd Ùr (no Linn na h-Impireachd Ùr uaireannan). On a chaidh a lorg, canar Rìgh Tut ris gu tric. Bha ainm tùsail, Tutankhaten, a’ ciallachadh \"dealbh beò Aten agus tha Tutankhamun a’ ciallachadh \"dealbh beò Amun\". Ann an dealbh-sgrìobhadh na h-Èipheite, sgrìobhar ainm mar Amen-tut-ankh a ghnàth an cois gnàthas an luchd-sgrìobhaidh a chuireadh ainm dè aig toiseach abairt mar urram dhan dia. Dh\u0027fhaoidte gur esan an neach air a bheil Nibhurrereya ann an litrichean Amarna agus tha deagh-choltas gur esan Rìgh Rathotis 18mh rìoghrachas na h-Èipheit a bha a’ riaghlaidh, a-rèir an eachdraidhe Manetho, fad naoidh bliadhna, faid a tha a-rèir an tionndaidh dhen Epitome aig Manetho a sgrìobh Flavius Josephus. Chaidh tuama Tutankhamun a lorg le Howard Carter agus Iarla Chaernarfon ann an 1922 agus leis gun robh e cha mhòr gun mhilleadh, ’s e naidheachd mhòr a bha ann air feadh an t-saoghail. Dhùisg e ùidh am measg nan daoine san Èipheit àrsaidh a-rithist agus tha aghaidh-choimheach Tutankhamun (ri fhaicinn ann an Taigh-tasgaidh na h-Èipheit) ainmeil air feadh an t-saoghail fhathast. Chaidh buill-ealain às an tuam a thaisbeanadh dhan phoball air feadh an t-saoghail thairis air na bliadhnaichean. Chaidh rannsachadh DNA a dhèanamh air agus sheall an rannsachadh sa Ghearran 2010 gur esan mac Akhenaten (mumaidh KV55). Bu mhumaidh KV35YL (is chan eil fhios dè an t-ainm a bha oirre) an dà chuid piuthair agus bean Akhenaten. A dh’aindeoin sin, tha cinnt gur ise am mumaidh air a bheil a’ Bhaintighearna Òg a chaidh a lorg san tuama KV35. A chionn ’s gun do chaochail grunnan dhe na daoine a rannsaich tuama Tutankhamun air dòigh caran \"annasach\", tha cuid am measg an t-sluaigh dhen bheachd gun do chaochail iad ri linn mallachd nam phàraoh. ...leugh an corr San latha an-diugh Maol Chaluim IV \u0027S e 9 an Dùbhlachd an 343mh latha dhen bhliadhna (344mh ann am bliadhna-leum). 1165 – Chaochail Maol Chaluim IV agus thòisich Uilleam I mar Rìgh na h-Alba. 1565 – Chaochail Pàpa Pius IV. 1669 – Chaochail Pàpa Clemens IX. 1868 – Rugadh Fritz Haber, ceimigear Gearmailteach. 1919 – Rugadh William Nunn Lipscomb, ceimigear] às na Stàitean Aonaichte. 1937 – Chaochail Gustaf Dalén, eòlaiche-fiosaig às an t-Suain. An robh fhios agaibh? B\u0027 e bàrd Gàidhlig agus pìobaire a bh\u0027 ann an Iain Eairdsidh MacAsgaill no Bàrd Bheàrnaraigh (19 Gearran 1898 — 4 Ògmhios 1934). B\u0027 ann à Beàrnaraigh na Hearadh a bha e. B\u0027 e mac Dhòmhnaill MhicAsgaill agus Anna Mhoireasdan a bh\u0027 ann. Bha piuthar aige, Effie. Bha aon bhràthair, Alexander, aige a chaidh ainmeachadh air a chlach-uaighe. Chaidh e do Sgoil Bheàrnaraigh eadar 1903 agus 1912. Ann an 1911, bha e agus a phiuthar Effie a\u0027 fuireach còmhla ri pàrantan am màthar, Calum agus Effie Moireasdan aig Croit 3, Borbh. Nuair a dh\u0027fhàg e sgoil, thòisich e ag obair mar chìobair agus chuir e seachad bliadhna ag obair do Chalum MacLeòid aig Sandhill. Liostaig e sna Cameron Highlanders an uair sin. Anns a\u0027 Chiad Chogadh, b\u0027 e pìobaire a bh\u0027 ann agus còmhla ri pìobairean eile sheòl e an rathad a-steach dhan chath aig Loos, an Fhraing san t-Sultain 1915...leugh an corr Mòr-Eòlas Saidheansan Teicneòlach is Gnìomhaichte Àiteachas - Ailtireachd - Cian-chonaltradh - Coimpiutaireachd - Conaltradh - Croitearachd - Dealan - Eadar-lìon - Eòlas-leighis - Buain na mòna - Giùlan - Iasgach - Innleadaireachd - Teicneòlas Saidheansan Daonna Àrsaidheachd - Cànan agus Cànanachas - Corp-eòlas - Cruinn-eòlas - Eachdraidh - Eòlas-comainn - Eòlas-inntinn - Feallsanachd - Foghlam - Teagasg Ealain, Dualchas is Cultar Ainmean - Bàrdachd - Ceòl - Cultar mòr-thaitneach - Dannsa - Ealain - Ealain-lèirsinneach - Film - Litreachas - Meadhanan - Rosg - Spòrs - Ur-sgeulachdan Saidheansan Nàdarra is Matamataig Beathaichean - Bith-eòlas - Ceimigeachd - Eigeòlas - Eòin - Geòlas - Matamataig - Eòlas-nàdair - Reul-eòlas - Dùile",
